INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSGM', 'STOCK', 'BioSig Technologies, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'BioSig Technologies, Inc. is a medical device technology company. The Company has an advanced digital signal processing technology platform, the PURE EP Platform (PURE EP), that delivers insights to electrophysiologists for ablation treatments of cardiovascular arrhythmias. PURE EP is designed to address long-standing limitations that slow and disrupt cardiac catheter ablation procedures, such as environmental lab noise from other equipment, signal saturation, slow signal recovery, and inaccurate display of fractionated potentials. PURE EP is a signal processing platform that combines advanced hardware and software to address known challenges associated to signal acquisition, to enable electrophysiologists to see more signals and analyze them in real-time. PURE EP is designed to enhance clinical decision-making and improve clinical workflows for all types of arrhythmias, even the challenging procedures for cardiac arrhythmias, like ventricular tachycardia and atrial fibrillation.', 'Los Angeles, CA, United States', 5);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEPC', 'STOCK', 'Brookfield Renewable Corporation', 'NYQ', 'Utilities', 'Utilities - Renewable', 'Brookfield Renewable Corp. operates renewable power platforms and sustainable solutions. The Companys portfolio consists of hydroelectric, wind, solar and storage facilities in North America, South America, Europe and Asia. It has approximately 33,000 megawatts of installed capacity and a development pipeline with approximately 155,400 megawatts. The Companys businesses include Renewable Power & Transition, Infrastructure, Private Equity, Real Estate, Credit and Insurance Solutions. Its Renewable Power & Transition business operates across five continents, managing a diverse portfolio of hydro, wind, solar, distributed energy and sustainable solutions. Its Infrastructure business owns and operates assets across the transport, data, utilities and midstream sectors. Its Private Equity business sectors include business services, infrastructure services and industrials. Its Real Estate business sectors include housing, logistics, hospitality, science and innovation, office, and retail.', 'New York, NY, United States', 2416);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOUG', 'STOCK', 'Douglas Elliman Inc.', 'NYQ', 'Real Estate', 'Real Estate Services', 'Douglas Elliman Inc. is a holding company. The Company is engaged in the real estate services and property technology (PropTech) investment business. The Companys segments include Real Estate Brokerage, and Corporate Activities and Other. The Real Estate Brokerage segment provides the residential real estate brokerage services through its subsidiary Douglas Elliman Realty, which operates residential brokerage companies in the New York metropolitan area and also conducts residential real estate brokerage operations in Florida, California, Texas, Colorado, Nevada, Massachusetts, Connecticut, Maryland, Virginia, Washington, D.C. Arizona, New Hampshire and Michigan. The Corporate Activities and Other the operations segment include operations of the holding company as well as its investment business that invests in select PropTech opportunities through our New Valley Ventures subsidiary. The Company''s PropTech investments include Rechat, Purlin, LiveEasy, Fyxify, Bilt, among others.', 'Miami, FL, United States', 783);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSIQ', 'STOCK', 'Canadian Solar Inc.', 'NMS', 'Technology', 'Solar', 'Canadian Solar Inc. is a Canada-based solar technology and renewable energy company. It is a manufacturer of solar photovoltaic modules, a provider of solar energy and battery energy storage solutions, and a developer of utility-scale solar power and battery energy storage projects with a geographically diversified pipeline in various stages of development. It operates through two segments: Recurrent Energy, and CSI Solar. The Recurrent Energy segment is vertically integrated and focuses on greenfield origination, development, financing, execution, operations and maintenance, and asset management. The CSI Solar segment consists of solar module and battery energy storage manufacturing, and delivery of total system solutions, including inverters, solar system kits, and engineering, procurement, and construction (EPC) services. It has developed, built, and connected around 10 Giga Watt peak (GWp) of solar power projects and 3.3 GWh of battery energy storage projects across the world.', 'Kitchener, ON, Canada', 17113);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNAI', 'STOCK', 'Brand Engagement Network, Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'Brand Engagement Network Inc. is a generative artificial intelligence (AI) (GenAI) company specialized in conversational AI solutions. Through its human-like AI agents (AI Agents), available in different modalities, it seeks to transform consumer engagement and elevate customer experience, productivity, and business performance. Its AI assistants are built on proprietary natural language processing, anomaly detection, multisensory awareness, sentiment and environmental analysis, as well as real-time individuation and personalization capabilities. Its platform is designed to configure, train and operate AI assistants that engage with professionals and consumers through multiple channels, boosting customer experience and providing instant personalized assistance for consumers in the automotive and healthcare markets. Its AI Agents can be offered to its clients customers through mobile apps, desktops or laptops, as well as through in-store life-size kiosks and SDK integrations.', 'Jackson, WY, United States', 39);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FR', 'STOCK', 'First Industrial Realty Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Industrial', 'First Industrial Realty Trust, Inc. É um fornecedor de imóveis industriais. A Companhia possui, opera, desenvolve e adquire propriedades logísticas. A Companhia, através de sua plataforma operacional e de investimento totalmente integrada, fornece instalações e atendimento ao cliente a corporações multinacionais e empresas regionais que são essenciais para suas cadeias de suprimentos. Seu portfólio e novos investimentos estão concentrados em 15 MSA-alvo com ênfase em mercados limitados à oferta e orientados para o litoral. A empresa possui e está em desenvolvimento aproximadamente 69,5 milhões de pés quadrados de espaço industrial. Seus inquilinos estão envolvidos em uma variedade de negócios, incluindo comércio eletrônico, logística e transporte de terceiros, produtos de consumo e outros produtos manufaturados, varejo e serviços de consumo, alimentos e bebidas, madeira e materiais de construção, bens de atacado, serviços de saúde, governamentais e outros. Através de uma TRS de proprie', 'Chicago, IL, United States', 151);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMPG', 'STOCK', 'AmpliTech Group, Inc.', 'NCM', 'Technology', 'Communication Equipment', 'AmpliTech Group, Inc. is engaged in designing, engineering, and assembling microwave component-based amplifiers. Its divisions include Specialty Microwave, Spectrum Semiconductor Materials, AmpliTech Group MMIC Design Center (AGMDC) and AmpliTech Group True G Speed Services (AGTGSS). Its products consist of radio frequency (RF) amplifiers and related subsystems, operating at multiple frequencies from 50 kilohertz (kHz) to 44 gigahertz (GHz), and custom assembly designs for the global satellite communications, telecom (fifth generation & Internet of Things), space, defense, and quantum computing markets. Its Specialty Microwave division designs and manufactures satellite communication microwave components, RF subsystems and specialized electronic assemblies for the military and commercial markets. AGMDC designs, develops, and manufactures signal processing components for satellites. AGTGSS division provides managed services, cybersecurity, cloud services, data sciences and others.', 'Hauppauge, NY, United States', 47);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CEPO', 'STOCK', 'Cantor Equity Partners I, Inc.', 'NGM', 'Financial Services', 'Shell Companies', 'Cantor Equity Partners I, Inc. is a blank check company. The Company is formed for the purpose of effecting a merger, share exchange, asset acquisition, share purchase, reorganization or similar business combination with one or more businesses. It intends to focus on companies operating in the financial services, healthcare, real estate services, technology and software industries. The Company is neither engaged in any operations nor generated any revenue.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRY', 'STOCK', 'Berry Corporation', 'NMS', 'Energy', 'Oil & Gas E&P', 'Berry Corporation (Bry) is an independent upstream energy company with a focus on onshore, low geologic risk, low decline, long-lived oil and gas reserves. The Company operates in two business segments: exploration and production (E&P) and well servicing and abandonment services. The E&P assets are located in California and Utah, are characterized by high oil content and are predominantly located in rural areas with a low population. The California assets are in the San Joaquin Basin (100% oil), and its Utah assets are in the Uinta Basin (65% oil). It provides its well servicing and abandonment services to third-party operators in California and its California E&P operations through C&J Well Services (CJWS). Its California operating area consists of properties located in Midway-Sunset, South Belridge, McKittrick and Poso Creek fields in the San Joaquin basin in Kern County. The Companys properties in this region are primarily mature, low-decline oil wells.', 'Dallas, TX, United States', 1070);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKV', 'STOCK', 'BKV Corporation', 'NYQ', 'Energy', 'Oil & Gas E&P', 'BKV Corporation is an energy company. The Company''s core business is to produce natural gas from its owned and operated upstream businesses. It has four business lines: natural gas production, natural gas gathering, processing and transportation (natural gas midstream business), and power generation and carbon capture, utilization and sequestration (CCUS). It is engaged in the acquisition, operation and development of natural gas and natural gas liquid (NGL) properties located in the Barnett Shale in the Fort Worth Basin of Texas (the Barnett) and in the Marcellus Shale in the Appalachian Basin of Northeastern Pennsylvania (NEPA). It has a 50% ownership interest in the BKV-BPP Power Joint Venture, which owns Temple Plants, a modern combined cycle gas and steam turbine power plant located in the Electric Reliability Council of Texas (ERCOT) North Zone in Temple, Texas. The Company''s operational projects include Barnett Zero Project, Eagle Ford Project, Ethanol Projects, and others.', 'Denver, CO, United States', 366);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ZION', 'STOCK', 'Zions Bancorporation, National Association', 'NMS', 'Financial Services', 'Banks - Regional', 'Zions Bancorporation, Associação Nacional (o Banco) é um provedor de serviços financeiros. Ele fornece uma gama de produtos bancários e serviços relacionados, principalmente nos estados do Arizona, Califórnia, Colorado, Idaho, Nevada, EUA. novo México, Oregon, Texas, Utah, Washington, e Wyoming. Realiza suas operações principalmente através de sete divisões bancárias gerenciadas e geograficamente definidas, cada uma com sua própria marca e gestão local. Seus produtos e serviços incluem bancos comerciais e de pequenas empresas, mercados de capitais e bancos de investimento, empréstimos imobiliários comerciais, bancos de varejo e gestão de patrimônio. Seus produtos e serviços bancários comerciais para pequenas empresas incluem empréstimos e leasing comerciais e industriais e ocupados por proprietários, serviços de finanças públicas e municipais, serviços de confiança corporativa e outros. Seus mercados de capitais e bancos de investimento incluem associações de empréstimos, subscrição de', 'Salt Lake City, UT, United States', 9440);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXTR', 'STOCK', 'Extreme Networks, Inc.', 'NMS', 'Technology', 'Communication Equipment', 'Extreme Networks, Inc. is a provider of cloud networking solutions and industry services and support. The Company designs, develops, and manufactures wired, wireless, and software-defined wide area-network (SD- WAN) infrastructure equipment, software and cloud-based network management solutions. Its cloud solution is a single platform that offers unified network management of wireless access points, switches, and SD-WAN. Its products and services categories include Cloud Networking Platform, Automation, Analytics, and Security Applications, Wireless LAN AP, Wired for Edge, Campus, and Data Center, SD-WAN, Cloud Native Platforms and Applications for Service Providers and Customer Service and Support. It provides service to various industries, including business, hospitality, retail, transportation and logistics, education, government, healthcare, and service providers. Its cloud networking technologies provide flexibility in deployment, management, and licensing of networks globally.', 'Morrisville, NC, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIIB', 'STOCK', 'Biogen Inc.', 'NMS', 'Healthcare', 'Drug Manufacturers - General', 'A Biogen Inc. É uma empresa biofarmacêutica global. A empresa está focada em descobrir, desenvolver e oferecer terapias avançadas para pessoas que vivem com doenças graves e complexas em todo o mundo. Ele opera um portfólio de medicamentos para tratar esclerose múltipla (EM), atrofia muscular espinhal (SMA), doença de Alzheimer e esclerose lateral amiotrófica (ELA). Está focada em avançar seu pipeline em neurologia, imunologia especializada e doenças raras. Seus produtos comercializados incluem TECFIDERA, VUMERITY, AVONEX, PLEGRIDY, TYSABRI e FAMPYRA para o tratamento da EM; SPINRAZA para o tratamento da SMA; SKYCLARYS para o tratamento da ataxia de Friedreich; QALSODY para o tratamento da ELA, e FUMADERM para o tratamento da psoríase severa. Também colabora com Eisai na comercialização do LEQEMBI para o tratamento da doença de Alzheimer e Sage na comercialização do ZURZUVAE para o tratamento da depressão pós-parto (PPD).', 'Cambridge, MA, United States', 7605);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BXMT', 'STOCK', 'Blackstone Mortgage Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Blackstone Mortgage Trust, Inc. is a real estate finance company that originates senior loans collateralized by commercial real estate in North America, Europe, and Australia. The Companys investment objective is to preserve and protect shareholder capital while producing attractive risk-adjusted returns primarily through dividends generated from current income from its loan portfolio. Its portfolio is composed primarily of loans secured by high-quality, institutional assets in major markets, sponsored by experienced, well-capitalized real estate investment owners and operators. These senior loans are capitalized by accessing a variety of financing options, depending on its view of the most prudent strategy available for each of its investments. The Company conducts its operations as a real estate investment trust for the United States federal income tax purposes. The Company is externally managed by BXMT Advisors L.L.C.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('REAX', 'STOCK', 'The Real Brokerage Inc.', 'NCM', 'Real Estate', 'Real Estate Services', 'The Real Brokerage Inc. is a real estate technology company that operates as a software-based brokerage across approximately 50 states in United Stated, the District of Columbia, and four Canadian provinces. Its platform leverages artificial intelligence (AI) and automation to enhance agent productivity while maintaining a lean operating model. The Company operates as a fully digital brokerage, offering agents a more flexible, efficient, and financially compelling model. Its technology platform is reZEN, is a proprietary transaction management and brokerage operations software. The Companys services include end-to-end transaction management, automated compliance & brokerage oversight, integrated payment & financial services, Leo CoPilot: AI-powered agent support, and open application programming interface (API) for customization.', 'Miami, FL, United States', 429);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHCT', 'STOCK', 'Community Healthcare Trust Incorporated', 'NYQ', 'Real Estate', 'REIT - Healthcare Facilities', 'Community Healthcare Trust Incorporated is a real estate investment trust. The Company focuses on owning income-producing real estate properties associated primarily with the delivery of outpatient healthcare services in its target submarkets throughout the United States. The Company owns and acquires real estate properties that are leased to hospitals, doctors, healthcare systems or other healthcare service providers. The Companys investment portfolio is diversified among healthcare facility types, such as medical office buildings, physician clinics, surgical centers and hospitals, specialty centers, behavioral facilities, inpatient rehabilitation facilities and long-term acute care hospitals, as well as being diverse both geographically and with respect to its tenant base. The Company has investments in approximately 200 real estate properties. The properties are located in 36 states, totaling approximately 4.4 million square feet in aggregate.', 'Franklin, TN, United States', 36);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARMN', 'STOCK', 'Aris Mining Corporation', 'ASE', 'Basic Materials', 'Gold', 'Aris Mining Corporation is a Canada-based gold mining company. The Company is primarily engaged in the acquisition, exploration, development and operation of gold properties in Colombia, Guyana and Canada. The Company operates two underground gold mines in Colombia, which are rich in high-grade deposits: the Segovia Operations and the Marmato Upper Mine. Its other projects include the Soto Norte Project, Toroparu Project, and the Juby Project. The Segovia Operations are 100% owned by the Company and are located in a historic mining district of Colombia and comprise four underground mines. The Marmato mine is 100% owned by the Company and is located in a historic mining district of Colombia and consists of the operating, small-scale underground Upper Mine and a 1,000 tons per-day (tpd) processing facility that produces dore. The Soto Norte Project is located in a historic mining district in Colombia. It holds a 51% joint venture interest and serves as the project operator.', 'Vancouver, BC, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESTC', 'STOCK', 'Elastic N.V.', 'NYQ', 'Technology', 'Software - Application', 'A Elastic NV é uma empresa de análise de dados sediada na Holanda. A plataforma da Companhia, que está disponível como um serviço hospedado e gerenciado em nuvens públicas, bem como um software autogerenciado, permite que seus clientes encontrem insights de grandes quantidades de dados e tomem medidas. A Companhia oferece três soluções baseadas em pesquisa - Enterprise Search, Observability e Security - que são incorporadas à plataforma, que é construída no Elastic Stack, um conjunto de produtos de software que ingerem dados de qualquer fonte, em qualquer formato e executam pesquisa, análise e visualização desses dados. A Companhia ajuda organizações, seus funcionários e seus clientes a encontrar o que precisam, mantendo os aplicativos de missão crítica funcionando sem problemas e os protegendo contra ameaças cibernéticas. A Companhia gera receita principalmente por vendas de assinaturas de sua plataforma.', 'Amsterdam, , Netherlands', 3537);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BL', 'STOCK', 'BlackLine, Inc.', 'NMS', 'Technology', 'Software - Application', 'A Blackline, Inc. Fornece uma plataforma unificada, escalável e flexível, adaptada às necessidades do Escritório do Diretor Financeiro (CFO) e oferece aplicativos específicos. A plataforma abrangente da empresa aborda processos de missão crítica, incluindo registro para relatório e fatura para caixa, permitindo dados unificados, processos simplificados e otimizados e insights em tempo real por meio de visibilidade, automação e inteligência artificial (IA). Seus aplicativos baseados na nuvem, equipados com a plataforma Blackline Studio360, incluem reconciliações de conta, correspondência de transações, gerenciamento de tarefas, análise de relatórios financeiros, e gerenciamento de transações. entrada de revistas, análise de variância, conformidade, gestão de crédito e risco, gestão de cobranças, faturação eletrónica e pagamentos, criação de empresas, equilíbrio e resolução entre empresas e liquidar entre empresas. Sua plataforma Blackline Studio360 inclui Studio360 Integrate, Studio360 ', 'Woodland Hills, CA, United States', 1830);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABEO', 'STOCK', 'Abeona Therapeutics Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Abeona Therapeutics Inc. is a commercial-stage biopharmaceutical company developing cell and gene therapies for serious diseases. The Company''s ZEVASKYN (prademagene zamikeracel) is an autologous cell-based gene therapy for the treatment of wounds in adults and pediatric patients with recessive dystrophic epidermolysis bullosa. Its fully integrated cell and gene therapy cGMP manufacturing facility in Cleveland, Ohio serves as the manufacturing site for ZEVASKYN commercial production. Its development portfolio features adeno-associated virus (AAV)-based gene therapies for ophthalmic diseases with high unmet medical need. Its AAV capsids are being evaluated to improve tropism profiles for a variety of devastating diseases. Its pipeline programs include ABO-504 (Stargardt disease), ABO-503 (X-linked retinoschisis), ABO-505 (autosomal dominant optic atrophy), UX111 (Sanfilippo Syndrome Type A (MPS IIIA)), TSHA-102 (Rett Syndrome), and TSHA-118 (Infantile Batten Disease (CLN1 Disease)).', 'Cleveland, OH, United States', 136);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALMU', 'STOCK', 'Aeluma, Inc.', 'NCM', 'Technology', 'Semiconductors', 'Aeluma, Inc. develops optoelectronic devices for sensing and communications applications. The Company is engaged in manufacturing devices using high-performance compound semiconductor materials on large-diameter substrates that are commonly used to manufacture mass market microelectronics. This enables manufacturing of high-performance photodetectors and photodetector array circuits for imaging applications in mobile devices, as well as other technologies. This technology has the potential to enhance the performance and capability of camera image sensors, light detection and ranging (LiDAR), augmented reality/virtual reality (AR/VR), facial recognition, and other applications. Its potential markets include automotive LiDAR, industrial LiDAR, robotics, mobile, AR/VR, AI, communications, and defense and aerospace.', 'Goleta, CA, United States', 11);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRSP', 'STOCK', 'BrightSpire Capital, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'BrightSpire Capital, Inc. is a commercial real estate (CRE) credit real estate investment trust. The Company is focused on originating, acquiring, financing and managing a diversified portfolio, consisting primarily of CRE debt investments and net leased properties predominantly in the United States. The Company''s segments include Senior and Mezzanine Loans and Preferred Equity, Net Leased and Other Real Estate, and Corporate and Other. The Senior and Mezzanine Loans and Preferred Equity segment has CRE debt investments, including senior loans, mezzanine loans, and preferred equity interests, as well as participation in such loans. The Net Leased and Other Real Estate segment includes direct investments in commercial real estate with long-term leases to tenants on a net lease basis. The Corporate and Other includes corporate-level asset management and other fees. The Company has offices in New York and Los Angeles, California.', 'New York, NY, United States', 48);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WAT', 'STOCK', 'Waters Corporation', 'NYQ', 'Healthcare', 'Diagnostics & Research', 'A Waters Corporation oferece instrumentos analíticos, tecnologias de separação e software, servindo a vida, os materiais, os materiais e os materiais necessários para o desenvolvimento de produtos e serviços. alimentos e ciências ambientais. Os segmentos da Companhia incluem Waters e TA. A empresa projeta, fabrica, vende e presta serviços de cromatografia líquida de alta eficiência (HPLC), cromatografia líquida de ultra-desempenho (UPLC e em conjunto com HPLC, conhecida como LC) e sistemas de tecnologia de espetrometria de massas (MS) e produtos de suporte, incluindo colunas de cromatografia, outros produtos consumíveis e planos de serviço abrangentes pós-garantia. A empresa projeta, fabrica, vende e presta serviços de análise térmica, reometria e calorimetria através de sua linha de produtos TA Instruments (TA). A Companhia também é desenvolvedora e fornecedora de produtos avançados baseados em software que fazem interface com os instrumentos da Companhia, bem como com os instrumentos', 'Milford, MA, United States', 7600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPT', 'STOCK', 'Camden Property Trust', 'NYQ', 'Real Estate', 'REIT - Residential', 'Camden Property Trust é um fundo de investimento imobiliário (REIT). A Empresa e suas subsidiárias estão principalmente envolvidas na propriedade, gestão, desenvolvimento, reposicionamento, redesenvolvimento, aquisição e construção de condomínios multifamiliares. Possui e opera aproximadamente 175 propriedades contendo 59 210 casas de apartamentos em todo os Estados Unidos. Tem três propriedades em desenvolvimento e consistirá de um total de 60 348 casas de apartamentos. Suas propriedades geralmente consistem em edifícios de arranha-céus ou edifícios de dois e três andares em um ambiente paisagístico, bem como edifícios altos, e fornecem aos moradores uma variedade de comodidades comuns às propriedades de aluguel multifamiliares. As propriedades da empresa incluem Camden Chandler, Camden Copper Square, Camden Foothills, Camden Legacy e outros. Suas propriedades estão localizadas no Arizona, Califórnia, Colorado, Washington District of Columbia (DC) Metro, Flórida e outros.', 'Houston, TX, United States', 1660);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSWC', 'STOCK', 'Capital Southwest Corporation', 'NMS', 'Financial Services', 'Asset Management', 'Capital Southwest Corporation is an internally managed business development company. The Company is a market lending firm focused on supporting the acquisition and growth of middle market businesses with investments across the capital structure, including first lien, second lien and non-control equity co-investments. It specializes in providing customized debt and equity financing to lower middle market (LMM) companies in a broad range of investment segments located primarily in the United States. Its investment objective is to produce attractive risk-adjusted returns by generating current income from its debt investments and capital appreciation from its equity and equity-related investments. It invests primarily in first-lien debt securities, secured by security interests in portfolio company assets. It also invests in equity interests in its portfolio companies alongside its debt securities. It also offers managerial assistance to its portfolio companies.', 'Dallas, TX, United States', 30);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ETNB', 'STOCK', '89bio, Inc.', 'NGM', 'Healthcare', 'Biotechnology', '89bio, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on the development and commercialization of therapies for the treatment of liver and cardio-metabolic diseases. The Companys lead product candidate, pegozafermin, a specifically engineered glycoPEGylated analog of fibroblast growth factor 21 (FGF21), is being developed for the treatment of metabolic dysfunction-associated steatohepatitis (MASH). Pegozafermin is engineered to protect against proteolysis and reduce renal clearance and optimize its potency, enabling the potential use of a lower dosage/dose. Pegozafermin has been optimally constructed with two mutations via substitutions with natural amino acids at site-specific positions (173 and 176) toward the C-terminus end of the hormone.', 'San Francisco, CA, United States', 93);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BASE', 'STOCK', 'Couchbase, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Couchbase, Inc. provides a cloud database platform for modern applications. The Company provides the developer data platform for critical applications in its artificial intelligence (AI) world. Its products include Couchbase Capella, Couchbase Server, Couchbase Mobile & Edge Computing, Couchbase Edge Server, and Intelligent Data Services. Its Couchbase Capella is a fully managed, automated, and secure DBaaS that simplifies deployment and operations across cloud environments. Its Couchbase Server is a multiservice NoSQL database that combines relational databases (ACID transactions, SQL++ for querying) with the scalability and flexibility of NoSQL. Its Couchbase Mobile is a full-featured embedded NoSQL database designed for mobile and IoT applications that require always-on availability. Its Couchbase Edge Server extends data processing to resource-constrained environments, providing low-latency access, offline resilience, and real-time synchronization.', 'Santa Clara, CA, United States', 804);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OTRK', 'STOCK', 'Ontrak, Inc.', 'NCM', 'Healthcare', 'Health Information Services', 'Ontrak, Inc. is a value-based behavioral healthcare company that identifies and engages people with unmet health needs using its advanced engagement system to improve clinical outcomes. The Company identifies, engages, and delivers care to the vulnerable members of the behavioral health population who would otherwise fall through the cracks of the healthcare system. Through its Advanced Engagement System, it engages individuals with anxiety, depression, substance use disorders and chronic disease by delivering personalized care coaching and customized care pathways that help them receive the treatment and advocacy they need, despite the socio-economic, medical and health system barriers that exacerbate the severity of their comorbid illnesses. It integrates AI, predictive analytics, comprehensive clinical and claims data, patient-generated information, and digital interfaces with care coach engagements to deliver improved member health and better healthcare system utilization.', 'Miami, FL, United States', 104);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('RVLV', 'STOCK', 'Revolve Group, Inc.', 'NYQ', 'Consumer Cyclical', 'Internet Retail', 'Revolve Group, Inc. is a fashion retailer for millennial and generation Z consumers. The Company is an online retailer and fashion brand. Through its Websites and mobile applications, it delivers a customer experience with a curated merchandise offering. The Company sells merchandise through two segments: REVOLVE and FWRD. REVOLVE segment offers an assortment of premium apparel, footwear, beauty, accessories and home products from emerging, established and owned brands. FWRD segment offers an assortment of curated and elevated iconic and emerging luxury brands. Its platform connects a community of consumers, global fashion influencers, and emerging, established, and owned brands. The Company offers products under various brands, such as Lovers and Friends, GRLFRND, NBD, Camila Coelho, Alexandre Vauthier, and House of Harlow 1960. Its customers can engage with the Company in approximately 12 languages and pay in over 50 currencies.', 'Cerritos, CA, United States', 1632);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANGL', 'STOCK', 'VanEck Fallen Angel High Yield Bond ETF', 'NGM', NULL, NULL, 'The fund normally invests at least 80% of its total assets in securities that comprise the fund''s benchmark index. The index is comprised of below investment grade corporate bonds denominated in U.S. dollars that were rated investment grade at the time of issuance.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLLS', 'STOCK', 'Cellectis S.A.', 'NGM', 'Healthcare', 'Biotechnology', 'Cellectis SA is a France-based company active in the field of genome engineering and genomic surgery. The Company specializes in the research, development, and commercialization of rational genome engineering technologies. The Company develops immunotherapies that aim to force the immune system to target and eradicate cancer cells. It has developed an expertise in combining meganucleases with engineered targeting Deoxyribonucleic Acid (DNA) matrices into Meganuclease Recombination Systems (MRS), used for gene excision, correction or replacement. Cellectis SA markets its technologies mainly for use in the research field, in pharmaceutical drug discovery programs, in the agronomics, bioproduction, and biotherapeutics fields. Cellectis SA operates several subsidiaries. The Company operates in France and the United States, among others.', 'Paris, , France', 216);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AKR', 'STOCK', 'Acadia Realty Trust', 'NYQ', 'Real Estate', 'REIT - Retail', 'Acadia Realty Trust is an equity real estate investment trust (REIT). The Company is focused on the ownership, acquisition, development, and management of retail properties located primarily in high-barrier-to-entry, supply-constrained, densely populated metropolitan areas in the United States. The Company operates through three segments: Core Portfolio, Investment Management, and Structured Financing. The Company''s Core Portfolio segment consists primarily of retail properties located primarily in high-barrier-to-entry, densely populated metropolitan areas with a long-term investment horizon. The Company''s Investment Management segment holds primarily retail real estate in which the Company co-invests with high-institutional investors. The Company''s Structured Financing segment consists of earnings and expenses related to notes and mortgages receivable. The Company has ownership interests in approximately 210 properties within its core portfolio and investment management.', 'Rye, NY, United States', 129);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARI', 'STOCK', 'Apollo Commercial Real Estate Finance, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Apollo Commercial Real Estate Finance, Inc. is a real estate investment trust. The Company primarily originates, acquires, invests in and manages performing commercial first mortgage loans, subordinate financings and other commercial real estate-related debt investments. Its principal business objective is to acquire its target assets in order to provide attractive risk- adjusted returns to its stockholders over the long term, primarily through dividends and secondarily through capital appreciation. Its investment strategy is to identify opportunities within its target assets through its manager and its affiliates as well as their platform, which integrates real estate experience with private equity and capital markets in transaction sourcing, underwriting, execution, asset operation, management and disposition. It targets assets that are secured by real estate throughout the United States and Europe. The Company is externally managed and advised by ACREFI Management, LLC.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DKS', 'STOCK', 'DICK''S Sporting Goods, Inc.', 'NYQ', 'Consumer Cyclical', 'Specialty Retail', 'A Dick''S Sporting Goods, Inc. É uma Varejista de artigos esportivos omni-channel. A empresa possui e opera Golf Galaxy, Public Lands, e indo embora! lojas especializadas concept, e também oferecem seus produtos on-line e através de suas aplicações móveis. Também possui e opera o Dick''s House of Sport e Golf Galaxy Performance Center, bem como o GameChanger, uma plataforma móvel de esportes para jovens para streaming ao vivo, agendamento, comunicações e scorekeeping. Ele opera aproximadamente 723 locais de artigos esportivos DA DICK em todos os Estados Unidos. Ele carrega uma grande variedade de marcas nacionais, incluindo, mas não limitado a, adidas, Asics, Brooks, Callaway Golf, Carhartt, Columbia, Hoka, Jordan, New Balance, Nike, peloton, The North Face, Under Armour, Wilson, Yeti, e outros. Suas marcas verticais incluem marcas que possui em linhas duras e softlines e estão disponíveis em suas lojas e on-line, como Alpine Design, CALIA, DSG, ETHOS, Fitness Gear, MAXFLI, Nishiki, Wa', 'Coraopolis, PA, United States', 18600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMPL', 'STOCK', 'Amplitude, Inc.', 'NCM', 'Technology', 'Software - Application', 'Amplitude, Inc. provides a digital analytics platform that helps companies unlock the power of their products. The Companys Digital Analytics Platform helps businesses understand how people are using their products so they can build digital experiences. Its platform comprises several primary offerings: Amplitude Analytics, Amplitude Session Replay, Amplitude Feature Experimentation, Amplitude Web Experimentation, Amplitude Activation and Amplitude Guides and Surveys. Amplitude Analytics is the cornerstone of the platform and provides real-time insights into user behavior. Amplitude Activation unifies data across multiple sources, creating a single, enriched dataset that fuels analytics and personalization. Amplitude Guides and Surveys helps companies to deploy in-product guides, tours, and surveys, using the power of behavioral insights to fuel great results. Amplitude Feature Experimentation enables product, data, and engineering teams to build world-class experiments.', 'San Francisco, CA, United States', 800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGX', 'STOCK', 'Argan, Inc.', 'NYQ', 'Industrials', 'Engineering & Construction', 'Argan, Inc. is a holding company. The Company is a construction firm that conducts operations through its subsidiaries, Gemma Power Systems, LLC and affiliates (GPS), Atlantic Projects Company Limited and affiliates (APC), The Roberts Company, Inc. (TRC), and Southern Maryland Cable, Inc. (SMC). Through GPS and APC, its power industry services, it offers a suite of engineering, procurement, construction, commissioning, maintenance, project development and technical consulting services to the power generation market, including the renewable energy sector. Through TRC, the industrial construction services provide field services and project management that support new plant construction and additions, maintenance turnarounds, shutdowns and emergency mobilizations for industrial plants. Through SMC, its telecommunications infrastructure services provide project management, construction, installation and maintenance services to commercial, local government and federal government customers.', 'Arlington, VA, United States', 1595);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EMN', 'STOCK', 'Eastman Chemical Company', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'Eastman Chemical Company é uma empresa global de materiais especiais que produz uma gama de produtos encontrados em itens que as pessoas usam todos os dias. Seus segmentos incluem Materiais Avançados (AM), Aditivos e Produtos Funcionais (AFP), Intermediários Químicos (CI) e Fibras. O segmento AM produz e comercializa polímeros, filmes e plásticos com propriedades diferenciadas de desempenho para usos finais de valor agregado no transporte; duráveis e eletrônicos; construção e construção; mercados finais médicos e farmacêuticos e consumíveis. O segmento AFP fabrica materiais para produtos em alimentos, rações e agricultura; transporte; tratamento de água e energia; cuidados pessoais e bem-estar; construção e construção; consumíveis, duráveis e mercados finais eletrônicos. O segmento CI vende intermediários para mercados finais, como produtos químicos industriais e processamento, construção e construção, saúde e bem-estar, alimentos e rações. Seu segmento de fibras fabrica e vende plasti', 'Kingsport, TN, United States', 14000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBSH', 'STOCK', 'Commerce Bancshares, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Commerce Bancshares, Inc. is a bank holding company offering a full line of banking services through its subsidiaries, including payment solutions, investment management and securities brokerage. The Companys subsidiary, Commerce Bank (the Bank), operates full-service banking facilities across the Midwest, including the St. Louis and Kansas City metropolitan areas, Springfield, Central Missouri, Central Illinois, Wichita, Tulsa, Oklahoma City, and Denver. It also maintains commercial offices in Dallas, Houston, Cincinnati, Nashville, Des Moines, Indianapolis, and Grand Rapids and wealth offices in Dallas, Houston, and Naples. Its segments include Commercial, Consumer, and Wealth. The Commercial segment provides a full array of corporate lending, merchant and commercial bank card products, payment solutions, leasing, and international services, as well as business and government deposit, investment, institutional brokerage, and cash management services.', 'Kansas City, MO, United States', 4658);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DTM', 'STOCK', 'DT Midstream, Inc.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'DT Midstream, Inc. is an owner, operator, and developer of natural gas interstate and intrastate pipelines, storage and gathering systems, compression, treatment, and surface facilities. The Company transports clean natural gas for utilities, power plants, marketers, large industrial customers, and energy producers. Its segments include Pipeline and Gathering. The Pipeline segment owns and operates interstate and intrastate natural gas pipelines, storage systems, and natural gas gathering lateral pipelines. It also has interests in equity method investees that own and operate interstate natural gas pipelines. The segment is engaged in the transportation and storage of natural gas for intermediate and end user customers. The Gathering segment owns and operates gas gathering systems. The segment is engaged in collecting natural gas from points at or near customers wells for delivery to plants for treating, to gathering pipelines for further gathering, or to pipelines for transportation.', 'Detroit, MI, United States', 556);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNOB', 'STOCK', 'ConnectOne Bancorp, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'ConnectOne Bancorp, Inc. is a financial services company that operates, through its subsidiary, ConnectOne Bank (the Bank) and the Banks fintech subsidiary, BoeFly, Inc (BoeFly). ConnectOne Bank is a commercial bank offering a full suite of banking and lending products and services that focus on small to middle-market businesses. The Bank''s offices are located primarily in the New York metro market and span New Jersey, New York City, Long Island, and the Hudson Valley, including Rockland, Orange, and Westchester counties. It offers a range of deposit and loan products. It also provides a range of other banking services. Its products and services include personal and business checking accounts, money market accounts, time and savings accounts, credit cards, safe deposit boxes, access to automated teller services and telephone, and others. BoeFly is a fintech marketplace that connects borrowers in the franchise space with funding solutions through a network of partner banks.', 'Englewood Cliffs, NJ, United States', 489);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMLX', 'STOCK', 'Amylyx Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Amylyx Pharmaceuticals, Inc. is a clinical-stage pharmaceutical company. The Company is focused on three investigational therapies across several neurodegenerative and endocrine diseases. Its lead investigational asset is avexitide, an investigational, first-in-class glucagon-like peptide-1 (GLP-1) receptor antagonist. Avexitide has been evaluated as a treatment for Post-Bariatric Hypoglycemia (PBH) and congenital HI, two indications characterized by hyperinsulinemic hypoglycemia. In addition to avexitide, it is advancing AMX0035, an oral, fixed-dose combination of sodium phenylbutyrate and taurursodiol in Wolfram syndrome and progressive supranuclear palsy (PSP), and AMX0114 in amyotrophic lateral sclerosis (ALS). AMX0035 is designed to mitigate neurodegeneration by targeting endoplasmic reticulum stress and mitochondrial dysfunction, two cellular processes central to neuronal cell death and neurodegeneration. AMX0114 is an investigational antisense oligonucleotide.', 'Cambridge, MA, United States', 123);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADC', 'STOCK', 'Agree Realty Corporation', 'NYQ', 'Real Estate', 'REIT - Retail', 'A ACORD Realty Corporation é uma confiança integrada de investimento imobiliário (REIT) focada principalmente na propriedade, aquisição, desenvolvimento e gestão de propriedades de varejo líquidas alugadas a inquilinos. Os ativos da Companhia são detidos e todas as suas operações são realizadas através, direta ou indiretamente, da parceria operacional, da qual a Companhia é o único sócio geral. Seu portfólio é composto por mais de 2 370 propriedades localizadas em 50 estados e totalizando aproximadamente 48,8 milhões de pés quadrados de área bruta locável (ABL). Seu portfólio de propriedades está localizado em Texas, Ohio, Flórida, Michigan, Illinois, EUA. Carolina do Norte, Nova Jersey, Pensilvânia, Califórnia, Nova Iorque, Geórgia, Virgínia, Connecticut, Wisconsin e outros. Seus inquilinos incluem Walmart, Dollar General, Tractor Supply, Best Buy, Dollar Tree, TJX Companies, O''Reilly Auto Parts, CVS, Kroger, Lowe''s, Hobby Lobby, Burlington, Sherwin-Williams, Sunbelt Rentals, Wawa, ', 'Royal Oak, MI, United States', 75);\n